(334, 1309, 'custom_css', '.sticky-info-layout-notice .vc_column-inner { display: table; width: 100%; }\n.sticky-info-layout-notice .porto-feature-box { display: table-cell; vertical-align: middle; }\n.sticky-info-layout-notice .feature-box .feature-box-info { padding-left: 10px; }\n.sticky-info-layout-notice .feature-box .feature-box-icon { padding: 0; }\n.sticky-info-layout-notice .feature-box i:before { margin-left: 0; }\n.sticky-info-layout-notice .feature-box .feature-box-info { -webkit-flex: none; -moz-flex: none; -ms-flex: none; flex: none; }\n.sticky-info-layout-notice .porto-feature-box .feature-box { justify-content: center; }\n.sticky-info-layout-notice .porto-feature-box:first-child .feature-box { justify-content: flex-start; }\n.sticky-info-layout-notice .porto-feature-box:last-child .feature-box { justify-content: flex-end; }\n@media (max-width: 767px) {\n  .sticky-info-layout-notice .inline-block { display: block; } \n}\n@media (max-width: 575px) {\n  .sticky-info-layout-notice .vc_column-inner,\n  .sticky-info-layout-notice .porto-feature-box { display: block; }\n  .sticky-info-layout-notice .porto-feature-box .feature-box { justify-content: flex-start; }\n  .sticky-info-layout-notice .porto-feature-box:last-child .feature-box { justify-content: flex-start; }\n}'),
