(898, 1057, 'custom_css', '.our-features .porto-sicon-box { padding: 40px 20px 20px; display: block !important; background: #fff; }\r\n.member-item .thumb-info .thumb-info-type { display: none; }\r\n.member-item .thumb-info .thumb-info-title { background: none; padding: 0; left: 30px; bottom: 30px; font-family: Oswald; font-weight: 400; letter-spacing: normal; }\r\n.testimonial blockquote { background: none; font-family: inherit; font-style: normal; }\r\n.testimonial blockquote p { font-family: inherit; color: #646a70; font-size: 15px; line-height: 27px; font-style: inherit; }\r\n.testimonial .testimonial-arrow-down { display: none; }\r\n.testimonial .testimonial-author { padding-left: 50px; }\r\n.testimonial .testimonial-author img { border-radius: 30px; }\r\n.testimonial blockquote:before,\r\n.testimonial blockquote:after { color: #141a1f; font-family: Georgia; font-size: 40px; font-weight: 700; }\r\n.testimonial .testimonial-author .testimonial-author-thumbnail { margin-right: 20px; }\r\n.testimonial .testimonial-author strong { padding-top: 5px; font-family: Oswald; font-weight: 400; font-size: 16px; }\r\n.testimonial .testimonial-author span { font-size: 15px; }\r\n\r\n.rtl .member-item .thumb-info .thumb-info-title { left: auto; right: 30px; }\r\n.rtl .testimonial .testimonial-author { padding-left: 0; padding-right: 50px; }\r\n.rtl .testimonial .testimonial-author .testimonial-author-thumbnail { margin-left: 20px; margin-right: 10px; }'),
