(3408, 76, '_form', '<h2 class=\"short\"><strong>Contact</strong> Us</h2>\n<div class=\"row\">\n    <div class=\"col-lg-6\">\n        <div class=\"form-group\">\n            <label for=\"contact-name\">Your name *</label>\n            [text* your-name id:contact-name class:form-control]\n        </div>\n    </div>\n    <div class=\"col-lg-6\">\n        <div class=\"form-group\">\n            <label for=\"contact-email\">Your email address *</label>\n            [email* your-email id:contact-email class:form-control]\n        </div>\n    </div>\n    <div class=\"col-lg-12\">\n        <div class=\"form-group\">\n            <label for=\"contact-subject\">Subject</label>\n            [select your-subject id:contact-subject class:form-control \"\" \"Option 1\" \"Option 2\" \"Option 3\" \"Option 4\" \"Option 5\"]\n        </div>\n    </div>\n    <div class=\"col-lg-6\">\n        <div class=\"form-group\">\n            <label>Checkboxes</label>\n            [checkbox your-checkboxes id:contact-checkboxes \"1\" \"2\" \"3\" \"4\" \"5\"]\n        </div>\n    </div>\n    <div class=\"col-lg-6\">\n        <div class=\"form-group\">\n            <label>Radios</label>\n            [radio your-radios id:contact-radios \"1\" \"2\" \"3\" \"4\" \"5\"]\n        </div>\n    </div>\n    <div class=\"col-lg-12\">\n        <div class=\"form-group\">\n            <label for=\"contact-attachment\">Attachment</label>\n            [file your-attachment id:contact-attachment]\n        </div>\n    </div>\n    <div class=\"col-lg-12\">\n        <div class=\"form-group\">\n            <label for=\"contact-message\">Message *</label>\n            [textarea* your-message id:contact-message class:form-control ]\n        </div>\n    </div>\n    <div class=\"col-lg-12\">\n        <label for=\"contact-captcha\">Human Verification *</label>\n    </div>\n    <div class=\"col-lg-8\">\n        <div class=\"form-group\">\n            [captchar your-captcha id:contact-captcha class:form-control]\n        </div>\n    </div>\n    <div class=\"col-lg-4\">\n        <div class=\"form-group\">\n            [captchac your-captcha]\n        </div>\n    </div>\n    <hr>\n    <div class=\"col-lg-12\">\n        <div class=\"form-group\">\n            [submit class:btn class:btn-primary class:btn-lg \"Send Message\"]\n        </div>\n    </div>\n</div>'),
